  const [expandedBox, setExpandedBox] = useState(null);

  const toggleExpand = (boxId) => {
    setExpandedBox(expandedBox === boxId ? null : boxId); 
  };

  return (
    <section id="skills">
      <section id="skills_content">
        <div className="sklheading">
          <span className="sklheading_txt">My Skills!</span>
          <span className="sklsubheading">my knowledge base</span>
        </div>
        
      </section>
    </section>
  );
}
